import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
    return (
        <div>
            <h1>Welcome to Project Management Tool</h1>
            <Link to="/create-project">Create a Project</Link>
            <br />
            <Link to="/projects">View Projects</Link>
        </div>
    );
}

export default Home;
